Girls: Toni Sweets  

Hey guys Shooter here, we bring you one of the most amazing ASS in the business today, she says her name is TONI. We get to this little spot it's like a mini museum or whatever, they serve like little finger food &amp; stuff, but when we got there &amp; Nat laid eyes on the waitress (Toni), he was focused on only one meal for the day. Now you know how slick he is, he told her he knew the owner of the spot, took her around for a tour explaining things in American history that NEVER HAPPENED... But guess what.. She fell for it &amp; it was on....... YOU'VE GOT TO SEE THIS!
